import { useState } from "react";
import Calendar from "../Components/Calendar";

const Dashboard = () => {
  const [user, setUser] = useState({
    firstname: "",
    lastname: "",
    email: "",
    phone: "",
    address: "",
  });

  const handleChange = (e) => {
    setUser({ ...user, [e.target.name]: e.target.value });
  };

  return (
    <div className="container mx-auto grid grid-cols-2 gap-4 p-11 mt-11">
      <div>
        <h1 className="text-2xl font-bold mb-4">
          Welcome {user.firstname} to your profile
        </h1>
        <ul className="list-disc pl-4">
          <li>
            Firstname:
            <input
              type="text"
              name="firstname"
              value={user.firstname}
              onChange={handleChange}
            />
          </li>
          <li>
            Lastname:
            <input
              type="text"
              name="lastname"
              value={user.lastname}
              onChange={handleChange}
            />
          </li>
          <li>
            Email:
            <input
              type="email"
              name="email"
              value={user.email}
              onChange={handleChange}
            />
          </li>
          <li>
            Phone:
            <input
              type="tel"
              name="phone"
              value={user.phone}
              onChange={handleChange}
            />
          </li>
          <li>
            Address:
            <input
              type="text"
              name="address"
              value={user.address}
              onChange={handleChange}
            />
          </li>
        </ul>
      </div>
      <Calendar />
    </div>
  );
};

export default Dashboard;
